public override void Run()
{
	if (UpdateArtifact.Value != -1)
	{
		int currVersion = UpdateArtifact.Value;
		if (currVersion != Worker.LastReadVersion)
		{
			Worker.Conflict++;
		}
		else
		{
			Worker.ConflictFreeUpdate++;
		}
		Worker.RelConflict =  Worker.Conflict / 
(Worker.Conflict+Worker.ConflictFreeUpdate )*100;
			Worker.RelConflictFreeUpdate =  Worker.ConflictFreeUpdate / (Worker.Conflict+Worker.ConflictFreeUpdate ) *100;

		UpdateArtifact.Value++;
		Worker.LastReadVersion = UpdateArtifact.Value;
	}
}

public override double Duration
{
	get { return 0; }
}

