foreach (ArtifactConflict s in ArtifactConflictList)
{

	foreach (ReadArtifact ra in s.ReadArtifactList)
	{
		ra.Artifact = s.ArtifactData;
	}
	foreach (Read2SyncArtifact r2sa in s.Read2SyncArtifactList)
	{
		r2sa.Artifact = s.ArtifactData;
	}
	foreach (UpdateArtifact ua in s.UpdateArtifactList)
	{
		ua.Artifact = s.ArtifactData;
	}
	foreach (ArtifactDelete ad in s.ArtifactDeleteList)
	{
		ad.Artifact = s.ArtifactData;
	}	
	s.Artifact = 1;
}
